import React from 'react'
import styled from 'styled-components'

const Title = styled.h1`
  color: red;
  font-size: 50px;
`

export default () => {

  const bla = new BrowserFingerprint({
    cookieKey: "__browser_fingerprint",
    toSetCookie: true,
    onlyStaticElements: true,
    settings: {
      path: "/",
      expires: 3600000,
      httpOnly: null
    }
  })

  return (
    <Title>My page</Title>
  )
}
